import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Header extends Component {
  render() {
    return (
      <div className="ui secondary pointing menu">
        <Link to="/strem" className="item">
          Streamy
        </Link>
      </div>
    );
  }
}

export default Header;
